function neighbours( category ){
	return []
		.concat( oneLess( category ) )
		.concat( oneMore( category ) )
		.concat( oneLess( category ).map( oneMore ).reduce( flatten ) )
		//.concat( oneLess( category ).map( oneMore ).reduce( flatten ).map( oneMore ).reduce( flatten ) )
	;
}

function oneMore( category ){
	var alphabet = ' abcdefghijklmnopqrstuvwxyzöäüß0123456789'.split( '' );
	
	var res = [];
	for( var i = 0; i <= category.length; i++ ){
		alphabet.forEach( function( letter ){
			var neighbour = category.substring( 0, i ) + letter + category.substring( i );
			res.push( neighbour );
		});
	}
	return res;
}

function oneLess( category ){
	var res = [];
	for( var i = 0; i < category.length; i++ ){
		var neighbour = category.substring( 0, i ) + category.substring( i + 1 );
		res.push( neighbour );
	}
	return res;
}

function findCategory( word ){
	var possibleCategories = categories.filter( category => n[ category ].indexOf( word ) >= 0 );
	
	if( possibleCategories.length == 1 ){
		if( possibleCategories[ 0 ] != word ){
			return possibleCategories[ 0 ] + '<->' + word + '';
		}
		return;
		//return possibleCategories[ 0 ];
	}
	if( possibleCategories.length == 0 ){
		return;
	}
	console.log( 'multi-cat: ' + word + ' - ' + possibleCategories );
}
